(58488, 'ABE53C6C-CA2F-403E-AE62-11DE290866A9', '￼Wow. I stumbled across this song that I had originally written right after the boys were born. I have no memory of recording this….the song is written from the perspective of an unborn child, hanging out as a spirit in the trees…checking us out as potential parent options….the conceit is that we don’t choose to have our children…they choose to have us. I find it really touching now, 20 yrs on, with 3 beautiful children. ', '688531550470042240', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-10-26T19:45:50.470042'),
