(58544, '456CCF70-27EC-4787-9D94-ABF1C8B60424', 'The book I’m reading said it well: “in one way or another we are all broken by experience and could easily spend our lives trying to come to terms with it….but there is something more important for us to do….the restoration of innocence after experience.”', '688589455929399552', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-10-27T11:50:55.929399'),
