(58548, '106087B1-76CC-4D92-9CEC-8315438E1EF1', 'I felt so good reading these notes we sent…reliving a little bit our early days of getting to know and love one another and having all of theses firsts and experiences. I could feel the deepening happen. ', '688589591158869760', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-10-27T11:53:11.158870'),
